=head1 DESCRIPTION

A set of information for a top contributor network flow in a monitor.
In a monitor, Network Flow Monitor returns information about the
network flows for top contributors for each metric. Top contributors
are network flows with the top values for each metric type.

=head1 ATTRIBUTES


=head2 DestinationCategory => Str

The destination category for a top contributors row. Destination
categories can be one of the following:

=over

=item *

C<INTRA_AZ>: Top contributor network flows within a single Availability
Zone

=item *

C<INTER_AZ>: Top contributor network flows between Availability Zones

=item *

C<INTER_VPC>: Top contributor network flows between VPCs

=item *

C<AWS_SERVICES>: Top contributor network flows to or from Amazon Web
Services services

=item *

C<UNCLASSIFIED>: Top contributor network flows that do not have a
bucket classification

=back



